jssearch.files = {"1":{"u":".\/\/addon-aweber.html","t":"AWeber Add-On ","d":"The AWeber Add-On is a premium one, you can buy it on our landing page. Thank you!"},"2":{"u":".\/\/addon-google-analytics.html","t":"Google Analytics Add-on ","d":"The Google Analytics add-on will allow you to track a form with different Google Analytics accounts or track several forms with a single Google Analytics account."},"3":{"u":".\/\/addon-manager.html","t":"Add-on Manager ","d":"Add-ons are small applications integrated to Easy Forms for sending data collected by forms to third-party applications."},"4":{"u":".\/\/addon-paypal.html","t":"PayPal Add-on ","d":"The PayPal Add-On is a premium one, you can buy it on our landing page. Thank you!"},"5":{"u":".\/\/addon-webhooks.html","t":"Webhooks Add-on ","d":"You can use the Webhooks Add-on to send data from your forms to any custom page or script you like. This page can perform integration tasks to transform, parse, manipulate and send your submission data to wherever you choose."},"6":{"u":".\/\/assets\/aec6ec4\/example.html","t":"Example","d":""},"7":{"u":".\/\/assets\/aec6ec4\/tests\/data\/other.html","t":"A completely different headline","d":"Lorem lorem lorem ipsum dolor sit amet, consetetur sadipscing elitr."},"8":{"u":".\/\/assets\/aec6ec4\/tests\/data\/simple.html","t":"This is an Example Page","d":"Lorem ipsum dolor sit amet, consetetur sadipscing elitr."},"9":{"u":".\/\/email-setup.html","t":"Email Setup ","d":"This guide will explain several things you should consider when setting up your email account, whether you use your hosting's SMTP server, an external provider such as Gmail, Yahoo Mail or Outlook (Hotmail), or even PHP mail() function."},"10":{"u":".\/\/form-analytics.html","t":"In-App Analytics ","d":"Want to know how well are your forms performing? Well, now you can do it fast and easy with the Easy Forms' In-App Analytics. Get the best results from your forms, improve them to increase your conversion rates and much more. Yes, with only a few steps, you can start tracking your forms and in real time! Try it now and see the difference!"},"11":{"u":".\/\/form-builder.html","t":"Form Builder ","d":"Form Builder is an Easy Forms key piece. It's where forms are created and updated. The form builder provides the necessary tools for add and remove fields as other HTML elements."},"12":{"u":".\/\/form-manager.html","t":"Form Manager ","d":"Form Manager is the application most important part. You can see here all the forms you have been created in Easy Forms, plus all the actions that can be performed with each. For example, you can access to the users submissions, create reports, view statistics and more."},"13":{"u":".\/\/form-report-builder.html","t":"Report Builder ","d":"Report Builder allows you to see the data collected by a form."},"14":{"u":".\/\/form-widget.html","t":"Form Widget (The embed code) ","d":"Embed code are a few lines of html and javascript that you can use to embed an Easy Forms\u2019 form into your own website. This is the easiest way to display a form on your site and the method least susceptible to errors. But also, one of the most important things about the form widget is that every time you make a change to your form in the form builder, the embedded form will automatically update."},"15":{"u":".\/\/index.html","t":"Easy Forms ","d":"Thank you for purchasing Easy Forms. If you have any questions beyond the scope of this documentation, please feel free to email us via our support page on CodeCanyon."},"16":{"u":".\/\/intro-easy-forms.html","t":"What is Easy Forms? ","d":"Easy Forms is a web application that will help you design and develop web forms quickly and easily. Actually, you will not need programming skills to make your forms work in minutes."},"17":{"u":".\/\/membership.html","t":"Membership ","d":"Easy Forms allows an Admin User activate an option to allow any person to log in for free. When this option is enabled, the login page changes and shows a link for anyone to register."},"18":{"u":".\/\/rule-builder.html","t":"Rule Builder ","d":"Rule Builder allows you to add conditional logic to your Forms in a quick and intuitive way without using a single line of code. You simply need to add a number of conditions to fulfill to implement a number of actions such as hide\/show HTML elements, enable\/disable fields, copy fields values, skip pages and do math."},"19":{"u":".\/\/start-customization.html","t":"Customizing Easy Forms ","d":"Easy Forms is an application developed in object oriented PHP under the MVC pattern. If you have programming skills, it will be easy to customize Easy Forms according to your requirements."},"20":{"u":".\/\/start-installation.html","t":"Installing Easy Forms ","d":"Easy Forms installation is a simple process that should not take more than a few minutes. The following installation guide will help you install Easy Forms on your server."},"21":{"u":".\/\/start-upgrading.html","t":"Upgrading Easy Forms ","d":"This document describes how to upgrade your Easy Forms application from 1.x to 1.4.2."},"22":{"u":".\/\/submission-manager.html","t":"Submission Manager ","d":"Submission Manager let you create, view, edit and delete data collected by your forms. To access the Submission Manager, you must go to Form Manager and click on the form name. From there click on Submission (Paper Airplane icon). Now you can check, edit or delete your submissions."},"23":{"u":".\/\/system-requirements.html","t":"System Requirements ","d":"If your server meets the following requirements, Easy Forms will run on it."},"24":{"u":".\/\/template-manager.html","t":"Template Manager ","d":"Create a template is as simple as creating a form. But if you need to create several similar or identical forms, first create a template, then you can create the forms you need with a few clicks."},"25":{"u":".\/\/theme-manager.html","t":"Theme Manager ","d":"Easy Forms has a tool that let you create themes that can be applied to a form to change their appearance, backgrounds, colors, text type, etc."},"26":{"u":".\/\/user-manager.html","t":"User Manager ","d":"Easy Forms has a special area for managing users. Letting you create users who have only access to information collected by certain forms."}};
jssearch.tokenizeString = function(string) {
		var stopWords = ["a","an","and","are","as","at","be","but","by","for","if","in","into","is","it","no","not","of","on","or","such","that","the","their","then","there","these","they","this","to","was","will","with","yii"];
		return string.split(/[\s\.,;\:\\\/\[\]\(\)\{\}]+/).map(function(val) {
			return val.toLowerCase();
		}).filter(function(val) {
			return !(val in stopWords);
		}).map(function(word) {
			return {t: word, w: 1};
		});
};